INSERT INTO `news` VALUES('Hobbynachwuchsturnier-in-Altmuenster', '', '', '<h2>Hobbynachwuchsturnier in Altmünster</h2><p><img src=\"data:image/png;base64,\" style=\"width: 154px;\" class=\"fr-fic fr-fil fr-dii\"></p><p><strong>19 Teilnehmer/-innen aus 6 Vereinen fanden den Weg nach Altmünster zum heurigen </strong><br><strong>Hobbynachwuchsturnier. Auch heuer war die Austragung vorerst wieder fraglich.</strong><br><strong> Erst nach Urgenzen kam die notwendige Teilnehmerzahl zustande, </strong><br><strong>wobei ATV-Andorf maßgeblich dazu beitrug (5 Teilnehmer/innen), dass</strong><br><strong> doch ein ausgeglichenes Turnier zustande kam. Erfreulich war, dass </strong><br><strong>nicht nur Betreuer sondern auch Familien der Spieler/innen mitgekommen</strong><br><strong> waren.</strong><br><br></p><p>Leider konnte kein U13 Bewerb bei den Mädchen gespielt werden. Das einzige U11 Mädchen (Mayer Babette; Sportunion Altmünster)<br>spielte deshalb bei den U15 Mädchen, wobei sie sich einen beachtlichen 2. Platz erkämpfte.</p><p>Für sehr viele Teilnehmer/innen war es wieder die erste Turniererfahrung, was ja auch Sinn der Veranstaltung sein soll.</p><p>Eric Hayböck (BC-Windischgarsten) spielte 2 Altersklassen höher und siegte auch auch dort nach spannenden Matches in der U15 Klasse.<br>Weitere Platzierungen in U15: 2.Pl. Florian Höller (Sport-Union Altmünster); 3.Pl. Noah Putz (Sport-Union Altmünster); 4.Pl. Kaltenbrunner Moritz (Union Ohlsdorf)</p><p>Bei den U11 DE siegte die schon etwas spielerfahrene Dalila Sekeric (Sportunion Altmünster). Weitere Platzierungen:<br> 2.Pl. Dana-Lynn Grafinger (Union Urfahr); 3.Pl. Jasmin Eder (ATV-Andorf);</p><p>Bei den U11 HE dominierte ganz klar Alexander Puschl aus Ohlsdorf. Weitere Platzierungen: 2.Pl. Florian Kreiseder<br>ebenfalls aus Ohlsdorf; 3.Pl. Max Baumgartner (BC-70 Linz); 4.Pl. Richard Feitzlmayr (ATV Andorf) 5.Pl. Felix Kirchberger (ATV-Andorf)</p><p>Bei den U13 HE konnte sich Neueinsteiger Höller Andreas (Sport-Union Altmünster) den 1. Platz sichern. Weitere<br>Platzierungen : 2.Pl. Felix Neuhuber (Sport-Union Altmünster); 3.Pl. Bachmayer Tobias (ATV-Andorf)</p><p>Bei den U15 DE siegte ebenfalls Hanna Neuhuber (Sport-Union Altmünster), ebenfalls Neueinsteigerin. Weitere<br>Platzierungen: 2.Pl. Babette Mayer (Sport-Union Atmünster); 3.Pl. Marlene Stein (Sport-Union Altmünster); 4.Pl. Viktoria Feitzlmayr (ATV-Andorf)</p><p><em>Zum Abschluss des Turniers gab es auch noch eine Tombola.<br>Auf Grund der sommerlichen Temperaturen wurden alle Spieler/innen mit einem Eis belohnt.</em></p><p><strong>[Bericht: Peter Kickinger]</strong></p>', '2018-08-14', 'data:image/png;base64,');
INSERT INTO `news` VALUES('Hobbynachwuchsturnier-in-Altmuenster-2', '', 'Hallo;I Bin;Der;Tooobiiii;', '<h2>Hobbynachwuchsturnier in Altmünster 2</h2><p><img src=\"data:image/png;base64,\" style=\"width: 154px;\" class=\"fr-fic fr-fil fr-dii\"></p><p><strong>19 Teilnehmer/-innen aus 6 Vereinen fanden den Weg nach Altmünster zum heurigen </strong><br><strong>Hobbynachwuchsturnier. Auch heuer war die Austragung vorerst wieder fraglich.</strong><br><strong> Erst nach Urgenzen kam die notwendige Teilnehmerzahl zustande, </strong><br><strong>wobei ATV-Andorf maßgeblich dazu beitrug (5 Teilnehmer/innen), dass</strong><br><strong> doch ein ausgeglichenes Turnier zustande kam. Erfreulich war, dass </strong><br><strong>nicht nur Betreuer sondern auch Familien der Spieler/innen mitgekommen</strong><br><strong> waren.</strong><br><br></p><p>Leider konnte kein U13 Bewerb bei den Mädchen gespielt werden. Das einzige U11 Mädchen (Mayer Babette; Sportunion Altmünster)<br>spielte deshalb bei den U15 Mädchen, wobei sie sich einen beachtlichen 2. Platz erkämpfte.</p><p>Für sehr viele Teilnehmer/innen war es wieder die erste Turniererfahrung, was ja auch Sinn der Veranstaltung sein soll.</p><p>Eric Hayböck (BC-Windischgarsten) spielte 2 Altersklassen höher und siegte auch auch dort nach spannenden Matches in der U15 Klasse.<br>Weitere Platzierungen in U15: 2.Pl. Florian Höller (Sport-Union Altmünster); 3.Pl. Noah Putz (Sport-Union Altmünster); 4.Pl. Kaltenbrunner Moritz (Union Ohlsdorf)</p><p>Bei den U11 DE siegte die schon etwas spielerfahrene Dalila Sekeric (Sportunion Altmünster). Weitere Platzierungen:<br> 2.Pl. Dana-Lynn Grafinger (Union Urfahr); 3.Pl. Jasmin Eder (ATV-Andorf);</p><p>Bei den U11 HE dominierte ganz klar Alexander Puschl aus Ohlsdorf. Weitere Platzierungen: 2.Pl. Florian Kreiseder<br>ebenfalls aus Ohlsdorf; 3.Pl. Max Baumgartner (BC-70 Linz); 4.Pl. Richard Feitzlmayr (ATV Andorf) 5.Pl. Felix Kirchberger (ATV-Andorf)</p><p>Bei den U13 HE konnte sich Neueinsteiger Höller Andreas (Sport-Union Altmünster) den 1. Platz sichern. Weitere<br>Platzierungen : 2.Pl. Felix Neuhuber (Sport-Union Altmünster); 3.Pl. Bachmayer Tobias (ATV-Andorf)</p><p>Bei den U15 DE siegte ebenfalls Hanna Neuhuber (Sport-Union Altmünster), ebenfalls Neueinsteigerin. Weitere<br>Platzierungen: 2.Pl. Babette Mayer (Sport-Union Atmünster); 3.Pl. Marlene Stein (Sport-Union Altmünster); 4.Pl. Viktoria Feitzlmayr (ATV-Andorf)</p><p><em>Zum Abschluss des Turniers gab es auch noch eine Tombola.<br>Auf Grund der sommerlichen Temperaturen wurden alle Spieler/innen mit einem Eis belohnt.</em></p><p><strong>[Bericht: Peter Kickinger]</strong></p>', '2018-08-14', 'data:image/png;base64,');
INSERT INTO `page_content` VALUES('1', 'vorstand', '1', 'Am 22.05.2018 wurde bei der Mitgliederversammlung im Olympiasttzpunkt/Linz der neue Vorstand fr die Funktionsperiode 2018-2021 gewhlt. Im Vorstand werden wichtige Entscheidungen stets gemeinsam getroffen. Die hchste Instanz ist Prsident Herbert Koch.');
